import './App.css';
import About from './components/About/About';
import Announcement from "./components/Announcements/Announcements";
import Bookings from "./components/Bookings/Bookings";
import FooterContact from "./components/Footer/FooterContact";
import Header from "./components/Footer/Header";
import Navigation from "./components/Navigation/Navigation";
import React, {Fragment} from 'react';
import hexAboutMePic from "../src/components/UI/assets/hexAboutMe.jpg";
import hexSchedulePic from "../src/components/UI/assets/hexSchedule.jpg";
import hexContactPic from "../src/components/UI/assets/hexContact.jpg";
import hexFaqPic from "../src/components/UI/assets/hexFAQ.jpg";
import hexMySpace from "../src/components/UI/assets/hexMySpace.jpg";
import hexDailyExercise from "../src/components/UI/assets/hexDailyExercises.jpg";
import hexSocials from "../src/components/UI/assets/hexSocials.jpg";

function App() {
    return (
        <Fragment>
            <Navigation/>

            <body>
            <h1 className={`mainHeader text-dark ff-serif-bold fs-800`}>Welcome to Bee Better Massage </h1>
            <div className='hero'>
                <Bookings/>
</div>




            <FooterContact/>

            </body>


        </Fragment>


    )
}

export default App;
